e0 ph\u1ea3n ng\u00e2m ch\u1ee7 b\u1ea1i nh\u00e2n \u0111inh \u003cbr\u003e - V\u1edbi s\u01a1n m\u00f9i kh\u00f4n, t\u00e2n d\u1eadu, b\u00ednh t\u00fd, s\u1eedu sinh kh\u1eafc nh\u1eadp n\u00ean l\u00e0 t\u1ea5n th\u1ea7n. \u003cbr\u003e C\u00e1c s\u01a1n n\u00e0y c\u00f3 n\u00fai, nh\u00e0 cao t\u1ea7ng, nhi\u1ec1u nh\u00e0 trong 100m tr\u1edf l\u1ea1i.  \u003cbr\u003e4. C\u00e1c cung v\u1ecb thu\u1ef7: l\u00e0 c\u00e1c s\u01a1n c\u00f3 s\u1ed1 16. C\u00e1c s\u01a1n canh th\u00e2n(t\u1eed), tu\u1ea5t(t\u1eed), qu\u00fd t\u00fd(t\u00f4n) sinh kh\u1eafc xu\u1ea5t l\u00e0 tho\u00e1i th\u1ea7n. \u003cbr\u003e C\u00e1c s\u01a1n n\u00e0y c\u00f3 thu\u1ef7, ng\u00e3 t\u01b0 \u0111\u01b0\u1eddng, c\u00f4ng vi\u00ean b\u00e3i \u0111\u1ed7 xe t\u1eeb 100 \u0111\u1ebfn 1500m. N\u1ebfu c\u00e1c th\u1ee7y n\u00e0y l\u1ea1i c\u00f3 s\u01a1n l\u00e0 ph\u1ee5c ng\u00e2m, ch\u1ee7 b\u1ea1i t\u00e0i   \u003cbr\u003e - C\u00e1c s\u01a1n \u0111inh ng\u1ecd, c\u00e0n, gi\u00e1p d\u1ea7n, t\u1ed1n th\u00ecn sinh kh\u1eafc nh\u1eadp l\u00e0 t\u1ea5n th\u1ea7n.\u003cbr\u003e C\u00e1c s\u01a1n n\u00e0y c\u1ea7n c\u00f3 th\u1ee7y trong 100m \u003cbr\u003e..................................................................\u003cbr\u003e\n    \u003c/div\u003e\n    ", "iconAnchor": [0, 0], "iconSize": [250, null]});
